posts.description:
A group of runners from Toronto, Canada chose to unplug and put the grind on hold in favour of something more.

@runningoffthegrid aims to take runners out of their urban context into a place where they can go beyond the miles, and dig deeper into the most common obstacles in sustaining a healthy lifestyle.

When it was all said and done, the group agreed that the goal is never just about the miles — it's who you're counting them with.
